function accountBalanceAfterPurchase(purchaseAmount: number): number {
    let initialBalance = 100;
    let roundedAmount: number;

    // Determine the nearest multiple of 10, rounding up if the remainder is 5 or more
    if (purchaseAmount % 10 >= 5) {
        roundedAmount = purchaseAmount + (10 - purchaseAmount % 10);
    } else {
        roundedAmount = purchaseAmount - (purchaseAmount % 10);
    }

    return initialBalance - roundedAmount;
};
